import React, { FC } from "react";
import "./Glooyot.css";
import { Glooya } from "../../components";

type GlooyotProps = {
  data: any[];
  deleteID: (documentId: string) => Promise<void>;
  setEditedGlooya: React.Dispatch<
    React.SetStateAction<
      | {
          title: string;
          price: number;
          imageURL1: string;
          imageURL2: string;
          paragraph: string;
          tags?: string[] | undefined;
          id: string;
          position: boolean;
        }
      | undefined
    >
  >;
};

const Glooyot: FC<GlooyotProps> = ({ data, deleteID, setEditedGlooya }) => {
  return (
    <div className="glooyot-wrapper">
      {data?.map((glooya: any, i: any) => (
        <Glooya
          glooya={glooya}
          key={i}
          deleteID={deleteID}
          setEditedGlooya={setEditedGlooya}
        />
      ))}
    </div>
  );
};

export default Glooyot;
